import './App.css';
import Navbar from './components/navebar/Navbar';
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
function App() {
  return (
    <div className="App">
    <Navbar/>  
    <Router>
        <Header />
        {/* <Home /> */}
        <Routes>
          <Route path="/pohai-ab" element={<About />} />
          <Route path="/pohai-next" element={<Blog  />} />
          <Route path="/project" element={<Body />} />
          <Route path="/list" element={<Products />} />

        </Routes>
      </Router>

    </div>
  );
}

export default App;
